import React from 'react';
import './App.css'

const Notes = ()=>{
  return(

    <><div className='result'>
        <h2 style={{marginTop:'10%'}}>Title</h2>
        <ol>
        <li><h3 style={{marginTop:'10%'}}>Task</h3></li>
        
        </ol>
        </div></>
  )
}

export default Notes
